import React, {useState, useMemo} from 'react';

const Row = ({data}) => {

	console.log("Table.js",data);

	const {id, title, completed} = data;

	return(		    
    	<tr key={id}>
	    	<td>{id}</td>
	    	<td>{title}</td>
	    	<td>{completed ? "true":"false"}</td>
	    	<td><button>Delete</button></td>
    	</tr>	    
	)
	
}

export default Row;
